import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import TableContainer from '@material-ui/core/TableContainer';
import TableSortLabel from '@material-ui/core/TableSortLabel';

import './table.css'


import axios from 'axios';
import logo from '../img/order.svg';

import fav from '../img/fav.svg';
import close from '../img/delete.svg';
import question from '../img/question.svg';
import { Button, Dialog, DialogActions, DialogContent, DialogContentText, Modal } from '@material-ui/core';
const styles = theme => ({



 test:{
        fontFamily:'Helvetica Neue',
     color:"red"
 },
  root: {
       fontFamily:'Helvetica Neue',
      marginLeft:'200px',
     width: '80%',

    overflowX: 'auto',
  },
  table: {
  fontFamily:'Helvetica Neue',
    minWidth: 100,
  },
  arrowDropUp:{
      color:'#000000'
  },
  dialog:{
    borderRadius: "40px ",
    backgroundColor:'red'

  }

});


function SimpleTable(props) {
  const { classes } = props;
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
     const baseUrl = 'https://virtuelodc-backend.herokuapp.com/quess'
   const [users, setUsers] = useState([]);
     const [FiltredUsers, setFiltredUsers] = useState([]);
 const [age, setAge] = React.useState('');

   const handleChange = (event) => {
     setAge(event.target.value);
   };

   const [sortOrder, setSortOrder] = useState('asc');
 const DropdownIndicator = (props) => (
         <div {...props.innerProps} className={classes.dropdown}>
             <button style={{backgroundColor:"white",border: "none"}}> <img src={logo} alt="" /></button>
             {/* <UnfoldMoreIcon   className={classes.arrowDropUp}/> */}

        </div>
     );


   useEffect(() => {
    axios.get(baseUrl).then(result => {
